:root {
    --bg-dark: hsl(222, 17%, 22%);
    --bg-dark-2: hsl(222, 17%, 29%);
    --bg-dark-2b: hsl(222, 17%, 31%);
    --bg-dark-2c: hsl(222, 17%, 33%);
    --bg-dark-3: hsl(222, 17%, 36%);
    --text-field-box: hsl(222, 17%, 43%);
    --border-color: hsl(222, 12%, 37%);
    --border-color-1b: hsl(222, 12%, 45%);
    --border-color-2: hsl(222, 12%, 53%);
    --text-white: hsl(222, 14%, 85%);
    --text-white-2: hsl(222, 14%, 76%);
    --text-white-3: hsl(222, 14%, 66%);
    --blue-url: hsl(208, 100%, 71%);
}

body {
    background-color: var(--bg-dark);
    color: var(--text-white);
}

a:-webkit-any-link, .sgg3Kw9L.sgg3DBTA, .sgg3Kw9L.sgg3DBTA:hover {
    color: var(--blue-url);
}

/* Tourney name header */
.regionWrapper-APP_TOURNAMENT_PAGE_WITH_BANNER-Banner, .sgg2Fv5m .sggAWKgK, .sgg2Fv5m, .tourney-content, .sgg23wWo .sgg2_2Pg, .sgg23wWo .sgg3mnWz {
    color: var(--text-white);
    background-color: var(--bg-dark);
}

/* Text headers */
.profileLayout.primaryTab .markdown-container h1, .profileLayout.primaryTab .markdown-container h2, .profileLayout.primaryTab .markdown-container h3, .profileLayout.primaryTab .markdown-container h4, .profileLayout.primaryTab .markdown-container h5, .profileLayout.primaryTab .markdown-container h6, .gg-form-box h1, .gg-form-box h2, .gg-form-box h3, .gg-form-box h4, .gg-form-box h5, .gg-form-box h6, h1, h2, h3, h4, h5, h6 {
    color: hsl(222, 0%, 97%);
}

/* Background */
.profileBelowHeader, .sgg2Qglf, .sgg1apK4, .profileLayout:not(.usesJsScroller) .admin-page-header, .flex-pane-container .flex-pane-main {
    background-color: var(--bg-dark);
}

/* Event sidebar */
.sggidOT8, .desktopProfileNav .tabletUpNavTrack, .sgg1Do28.sgg1-zJm:before, .admin-page-header, .flex-pane-container .flex-pane-affix {
        background-color: var(--bg-dark-2);
}

/* Sidebar > events */
.sgg1yOFc, .sgg1yOFc:active, .sgg1yOFc:hover  {
    background-color: var(--bg-dark-2);
}

/* Event name (Melee, Brawl, etc) */
.sgg1yOFc a.sgg3TG_H .sgg__om6 .sgg3g3Br .sgg2pphX, .sgg1yOFc:active, .sgg1yOFc:hover, .sgg3Kw9L.sgg2RBnw, .sgg3Kw9L.sgg2RBnw:hover{
    color: var(--text-white);
}

/* Event name (bar hover) */
.sgg1yOFc:active a.sgg3TG_H .sgg__om6 .sgg3g3Br .sgg2pphX, .sgg1yOFc:hover a.sgg3TG_H .sgg__om6 .sgg3g3Br .sgg2pphX {
    color: var(--text-white)
}
/* Event listings on tourney page */
.sgg2DEbQ, .sgg2DEbQ .sgg2NOuX .sgg2RaXF .sgg1tPMW {
    background-color: var(--bg-dark-2);
    color: var(--text-white);
}

/* Individual event page header */
.regionWrapper-APP_TOURNAMENT_PAGE-GlobalNav-MuiTypography-h4, .regionWrapper-APP_TOURNAMENT_PAGE-GlobalNav-MuiTypography-h5 {
    color: var(--text-white);
}
.sgg2wMdK.sgg3GKnQ.sgg1lI09 .sgg2BjhO, .sggoAjjP .sgg1sD7J, .sggoAjjP .sggXOKua {
    background: var(--bg-dark);
    color: var(--text-white);
}

/* Entrants */
.sgg1kPUs, .sgg15Vs9 table th, [class*=".regionWrapper-APP_TOURNAMENT_PAGE-FeatureCanvas-gamerTag"], [class*="APP_TOURNAMENT_PAGE_WITH_BANNER-FeatureCanvas-gamerTag-"] {
    background: var(--bg-dark-2);
    color: var(--text-white);
}
/* Attendees bg hover */
.sgg15Vs9.sgg2TeZ2 tbody tr:nth-child(2n):hover, .sgg15Vs9.sgg2TeZ2 tbody tr:nth-child(odd):hover {
    background-color: var(--bg-dark-3)
}
/* Attendees > entrant tag */
.regionWrapper-APP_TOURNAMENT_PAGE-DesktopProfileNav-body16-makeStyles-jss12, [class*="regionWrapper-APP_TOURNAMENT_PAGE_WITH_BANNER-GlobalNav-gamerTag"], [class*="regionWrapper-APP_TOURNAMENT_PAGE-FeatureCanvas-title"] {
    color: var(--text-white);
}

/* Attendees > entrant IRL name */
[class*="-GlobalNav-nameSection"], [class*="-FeatureCanvas-nameSection"], [class*="GlobalNav-nameContainer-"] {
    color: var(--text-white-3)
}
/* Attendees > page number on hover*/
.sgg1u0BK .sgg2vKef .sggkdq1U:hover {
    background: var(--bg-dark-3)
}

/* Empty text box placeholder text (Details > Rules), "Teams" text */
.sgg1mzlH::placeholder, .empty-state-container {
    color: var(--text-white-3) !important;
}

/* */
.sgg3NREJ .sgg1oTKb {
    background-color: var(--bg-dark-3)
}
/* Loading rectangle fill */
rect {
    fill: var(--bg-dark-3) !important
}

.match .match-spacer {
    border-color: var(--bg-dark-3)
}
/* "Match is coming up" blue text */
.sggK8ZeW.sgg2jTHe, .sggK8ZeW.sgg3As8U {
    color: hsl(210, 86%, 68%)   
}

/* Match button text */
.match-quick-options {
    background: hsl(220, 20%, 42%);
    border: 0.2rem solid hsl(220, 30%, 28%) !important;
}

/* Match buttons text */
.match-quick-container .btn {
    color:var(--text-white-2);
}
/* Button text hover */
.regionWrapper-APP_TOURNAMENT_PAGE-NavTray-outlinedPrimary-makeStyles-jss8:hover {
    color:var(--text-white);
}
.match-quick-options .btn {
    border-color: hsl(220, 30%, 25%) !important
}

/* Bottom border of matches */
.border-bottom-items:not(.no-line) {
    border-color: var(--bg-dark-2);
}
/* Sidebar options text (Home, Attendees, ...) */
.sgg1Ff3D, label, .sgg1OAFg .sgg13k6s.sgg22Qh1 .sggxbi5m .sgg1Ff3D, .sgg1OAFg .sgg13k6s.sgg22Qh1 .sggxbi5m .sgg2p_3v, .sgg1OAFg .sgg13k6s.sgg22Qh1 .sggxbi5m .sgg3YjBM {
    color: var(--text-white-2) !important;
}

/* Sidebar options fill color */
.sgg1OAFg .sgg13k6s.sgg22Qh1, .sgg1OAFg .sgg13k6s:hover {
    background-color: var(--bg-dark-3)
}
/* Sidebar icons hover (gamepad etc) */
.sgg1OAFg .sgg13k6s .sggxbi5m:hover .sgg2p_3v {
    color:hsl(0, 0%, 68%);
}
/* Sidebar icons selected */
.sgg1OAFg .sgg13k6s.sgg22Qh1 .sggxbi5m .sgg2p_3v {
    color:#8e8e8e;
}

/* Tourney dashboard */
.profileLayout .page-section.page-section-grey, .adminContents {
    background-color: var(--bg-dark);
}
.appEntry-MuiDrawer-root {
    background-color: hsl(222, 17%, 20%);
}

/* Box background (e.g. registration settings Social Connections) */
.sgg2trFL.sggXgbgc {
    background-color: hsl(222, 19%, 32%);
    border-color:var(--border-color-2);
}
/* Text fields */
.regionWrapper-APP_TOURNAMENT_PAGE-FeatureCanvas-MuiOutlinedInput-root, .sgg3NREJ .sgg1mzlH, .gg-form-box {
    background-color: var(--text-field-box);
    color: hsl(0, 0%, 90%);
}
.regionWrapper-APP_HOMEPAGE-GlobalNav-MuiTypography-colorTextSecondary {
    color: hsl(222, 12%, 75%);
}

/* Borders in main tourney page */
.sgg2RaXF .sgg39Cf8:before, .sgg2RaXF .sggEEhSi .sggBYbiy:before {
    background-color: var(--border-color);
}

/* Player tags in event page */
.regionWrapper-APP_TOURNAMENT_PAGE_WITH_BANNER-GlobalNav-gamerTag-makeStyles-jss261, .regionWrapper-APP_TOURNAMENT_PAGE-FeatureCanvas-gamerTag-makeStyles-jss137 {
    color: var(--text-white);
}

/* Player avatar border */
[class*="regionWrapper-APP_TOURNAMENT_PAGE-GlobalNav-avatar-makeStyles-jss13"] {
    border-color: var(--border-color)
}

/* Text field (uneditable), i.e. "Short slug smash.gg/" */
.regionWrapper-APP_TOURNAMENT_PAGE_WITH_BANNER-GlobalNav-MuiTypography-colorTextSecondary {
    color: var(--text-white-2);
}

/* Grey text (time zones, player names etc) */
.regionWrapper-APP_TOURNAMENT_PAGE-FeatureCanvas-MuiFormHelperText-root, .regionWrapper-APP_TOURNAMENT_PAGE_WITH_BANNER-GlobalNav-nameSection-makeStyles-jss240 {
    color:hsl(222, 17%, 67%)
}

.regionWrapper-APP_TOURNAMENT_PAGE-FeatureCanvas-nameContainer-makeStyles-jss115 {
    color:hsl(222, 17%, 67%)
}

/* Yellow warning text (e.g. region-restricted tourney text) */
.regionWrapper-APP_TOURNAMENT_PAGE-FeatureCanvas-alertText-makeStyles-jss504.warning {
    color:hsl(50, 100%, 45%);
}

/* Green text */
.text-success {
    color:hsl(121, 32%, 63%);
}
/* Form box ("Waves") */
.gg-form-box {
    background-color: var(--bg-dark-2);
}

/* Yellow box overlay (i.e. Bracket Setup active box)*/
.bracket-setup-page .phase-setup-list .gg-form-box-section.active, .bracket-setup-page .phase-setup-list .gg-form-box-section.editing {
    background-color:var(--bg-dark-3);
} 

/* Inner box i.e. tiebreaker rules */
.bottom-spacer-sm, .attendee-card-event-body, .pagination-wave-tabs li, .tipped-off-timer .splash-timer h3 {
    background-color: var(--bg-dark-3);
}

.table-striped>tbody>tr:nth-of-type(odd) {
    background-color: var(--bg-dark-2b);
}

.regionWrapper-APP_TOURNAMENT_PAGE-GlobalNav-gamerTag-makeStyles-jss160 {
    color: var(--text-white);
}
.gg-list-group>*:last-child {
    background-color: var(--bg-dark-3);
    border-color: var(--border-color);
}

/* Seed generator and misc tables */
.table .table, .shadow-box, .wave-group-list.full-width .phase-seeding-group-item .seed-panel-body {
    background-color:var(--bg-dark-3);
}

/* Blue notice bar ("Looking to customize your homepage..." */
.regionWrapper-APP_TOURNAMENT_PAGE-FeatureCanvas-root-makeStyles-jss5 {
    background-color: hsl(222, 18%, 38%);
    border-top-color: hsl(222, 18%, 59%);
    color: var(--text-white);
}

/* "Not publically visible" lock */
.sgg25w2g {
    color: hsl(208, 60%, 65%);
}

/* Image upload box */
.sggZ4yaW .sgg2VBor, .sggZ4yaW .sggIlIQ7 {
    background: var(--bg-dark);
    color: hsl(360, 81%, 66%);
}

.gg-form-box-section .gg-list-group .gg-list-group-item {
    background-color: var(--bg-dark-2);
        color:var(--text-white);
}

/* Page buttons */
.sgg1u0BK .sgg2vKef .sggkdq1U.sgg2QvM9, .sgg1u0BK .sgg2vKef {
    color: var(--text-white);
    background: var(--bg-dark-2)
}

/* Page buttons table border, Attendees table border, Details > Rules text box border, Details > Images border */
.sgg1u0BK .sgg2vKef .sggkdq1U, .tappable-component, sgg15Vs9 table tbody td, .sgg3NREJ .sgg3E9Qz, .sggZ4yaW .sgg2VBor, .sggZ4yaW .sggIlIQ7, .sgg2Fv5m, .gg-form-box .gg-form-box-section+.gg-form-box-section:not(.no-line), div#gg-form-box {
    border-color: var(--border-color-2) !important
}

/* forgot what this one is */
.profileBelowHeader, .sgg2Qglf, .sgg1apK4, .profileLayout:not(.usesJsScroller) .admin-page-header, .flex-pane-container .flex-pane-main {
    border-color: var(--border-color-2) !important
}

/* Sub text (Registration Settings > Fields */
.gg-list-group-item-text {
    color: var(--text-white-3)
}
/* Bar at the top of event sidebar "*/
.navBanner, .desktopProfileNav .profileNavBanner::after {
    background: var(--bg-dark-2);
    background-color: var(--border-color);
}
.desktopProfileNav .profileNavBanner::after {
    bottom: 0px;
    height: 2px;
}

/* "Public" tab on event sidebar */
.sgg1Do28.sgg1-zJm .sgg3snLL.sgg21Zoj {
    color: var(--text-white)
}
/* "Edit" big overlay (e.g. registration settings) */
.item-overlay, .gg-list-group-item-overlay {
     color: hsla(222, 100%, 30%, .76);
}

/* Blue button ("Add admin") */
.regionWrapper-APP_TOURNAMENT_PAGE-FeatureCanvas-MuiButton-outlinedPrimary {
    color: var(--blue-url);
}

/* Attendees via event page front, fill color */
[class*="regionWrapper-APP_TOURNAMENT_PAGE-GlobalNav-passportWithAvatar"],  [class*="regionWrapper-APP_TOURNAMENT_PAGE_WITH_BANNER-FeatureCanvas-passportWithAvatar"] {
    background-color: var(--bg-dark-2)    
}
/* Border color in "Details" */
.sgg1k35w.sgg30sfD+.sgg1k35w.sgg30sfD, .sgg1k35w.sgg30sfD+.sgg1XZEH, .sgg15V3Y+.sgg1k35w.sgg30sfD, .sggnakGZ {
    border-color: var(--border-color) !important;
}

/* Border below Settings > Dashboard */
.sggnakGZ:after {
    background-color: var(--bg-dark-3) !important;
}

/* Tournament details > Short slug */
.regionWrapper-APP_TOURNAMENT_PAGE-GlobalNav-MuiTypography-colorTextSecondary {
    color:var(--text-white-2);
}

/* Annoying "looking to customize your page" block */
div#TournamentDetails-details {
    display:none;
}
/* Bracket setup > progressions */
.gg-well-warning, .bracket-setup-page .phase-setup-list .gg-form-box-section.active .gg-well, .bracket-setup-page .phase-setup-list .gg-form-box-section.editing .gg-well {
    background-color: var(--bg-dark-2b);
    border-color: var(--border-color-2)
}

/* Brackets "breadcrumb" at top of page (Brackets / Melee Singles / Pools) */
.breadcrumb, .sgg38NX3 {
    background-color:var(--bg-dark-3) !important;
}

/* Match dashboard */
.filters-container.table-filter {
    background-color: var(--bg-dark-3);
    border-color: var(--border-color-2)
}

.flex-box.flex-align-center.flex-space-between.padding-sm.toggle-filter-button-body {
    background-color:var(--bg-dark-3);
    color:var(--text-white);
}

/* Light blue notice bar */
[class*="appEntry-MuiPaper-elevation1 appEntry-MuiPaper-rounded"] {
    border-top: 0.2rem solid hsla(205, 62%, 50%, .43);
    background-color: hsla(209, 36%, 37%, .46);
    color:var(--text-white)
}
/* Events card */
.Card, .ObjectCard, .EventCard, .MatchCard, .EventCardV2, .TournamentCard, .TournamentEventCard, .ResultsCard, .ShopCard, .CircuitCard, .DeckSummaryCard, .LoadingCard, .PoolCard, .FantasyCard, .NotifCard, .HelpCard {
    background-color: var(--bg-dark-2);
}

/* Tournament set "card" */
.gg-card, .gg-card-body.gg-card-body-grey {
    background-color:hsl(222, 17%, 37%);
}
/* Card player fill */
.match .match-player, .rr-match .match-player {
    background-color: var(--bg-dark-2);
}
/* Card borders */
.match>.match-affix-wrapper>.match-section, .rr-match>.match-affix-wrapper>.match-section {
    border-color: var(--bg-dark-2);
}
/* Tourney set card text */
.gg-card, .match .match-player.entrant, .rr-match .match-player.entrant {
    color: var(--text-white);
}

/****
*****
* Pools & Seeding player table
*****
*/
/* Background */
.expanded .seed-panel .phase-seed-list, .full-width.wave-group-list .phase-seed-list, .scrollbar-container.seed-panel-body.ps-container.ps-theme-default {
    background-color:hsl(222, 17%, 23%) !important;
}

/* Divider */
.player-avatar .avatar-body.has-attachment:not(.no-border) {
    border-color: hsl(220, 14%, 10%);
}

/* Cell colors */
ul.striped>li:nth-of-type(even) {
    background-color: var(--bg-dark-2)
}
ul.striped>li:nth-of-type(odd) {
    background-color: hsl(222, 17%, 26%);
}

.seed-panel .phase-seed-row .player-avatar {
    color: var(--text-white);
}

/* Green divider */
.seed-panel .phase-seed-row.line-below {
    border-color: hsl(138, 68%, 33%)
}

/* Unseeded icon */
.text-danger-brand {
    color: hsl(222, 16%, 73%)
}

/* Drop player */
.text-primary-brand {
    color:hsl(0, 46%, 54%);
}
/* MATCH WINDOW */
.MatchHeader, .report-modal .modal-container {
    background: var(--bg-dark)
}
.report-modal .modal-tabs .tab-pane, .match-display .modal-tabs .tab-pane, .team-roster-cell {
    background-color: var(--bg-dark-2);
    border-color: var(--border-color-1b)
}

/* Active tab text color */
.report-modal .modal-tabs .navbar-nav li.active>a, .match-display .modal-tabs .navbar-nav li.active>a {
    color: var(--text-white)
}

/* Inactive tab hover color */
.nav>li>a:hover, .Nav>li>a:hover, .nav>li>a:focus, .Nav>li>a:focus {
    border-color: var(--bg-dark-3) !important
}
/* "Help with brackets" delet */
.sgg2h1cC.DEPRECATED_bootstrap_container.undefined.top-spacer {
    display: none   
}

/* Match round (not started) */
.sggjooyc.sgg2jTHe, .sggjooyc.sgg3As8U {
    background-color: hsl(210, 40%, 37%)
}
/* Match round (started) */
.sggjooyc.sgg7a-5i {
    background-color: hsl(125, 40%, 27%)
}

/* Match round header, entrant score */
.gg-color-white, .EntrantScore {
    color: var(--text-white)
}

/* Summary > stage name */
.GameStat__title {
    color: var(--text-white-2)
}

/* Player header before reporting game */
.report-modal .player-report.player-report-columns, .match-display .player-report.player-report-columns {
    background: none;
    border: none;
}

/* Report > winner overlay color */
.gg-list-group-item-success {
    background-color: hsl(125, 17%, 33%)
}
/* Messenger button in bottom-right */
.intercom-lightweight-app {
    display:none;
}
}
